measurements.description:
One flat flower on one 26-cm inflorescence;
	dorsal sepal white, light yellow bassally, overlaid coarse mahogany spots;
	synsepal light yellow, linear mahogany spots;
	petals light yellow, overlaid mahogany,  darker superior mahogany spots basally;
	pouch light yellow, overlaid mahogany;
	staminode light yellow overlaid mahogany speckles;

	substance firm; texture matte.
